import React from 'react';
import styles from './Menu.module.css';  

const menu = (props) => (

    <div className={styles.Menu}> 
         <div onClick={props.open}> </div> 
         <a onClick={props.open}> </a> 
         <a onClick={props.open}> </a> 
    </div>
    
);



export default menu;
